class Solution:
    def partitionString(self, s: str) -> List[str]:
        se, rs, n, i = set(), [], len(s), 0
        while i < n:
            cu, j = '', i
            while j < n:
                cu += s[j]
                if cu not in se:
                    se.add(cu)
                    rs.append(cu)
                    i = j + 1
                    break
                j += 1
            else: break
        return rs

class Solution:
    def partitionString(self, s: str) -> List[str]:
        r, t, i = [], set(), 0
        for j in range(len(s)):
            c = s[i:j+1]
            if c not in t: r.append(c); t.add(c); i = j + 1
        return r

class Solution:
    def partitionString(self, txt):
        op, mem, tmp = [], set(), ""
        for z in txt:
            k = tmp + z
            if k not in mem:
                op.append(k)
                mem.add(k)
                tmp = ""
            else:
                tmp = k
        return op
